import React, { Fragment } from "react";
import AboutUsPage from "./AboutUs/AboutUsPage";
import ProgramsPage from "./Programs/ProgramsPage";
import WaitlistInfoPage from "./WaitlistInfo/WaitlistInfoPage";

const InformationPages = props =>{
    return(
        <Fragment>
            {props.PageSelector === 'About Us' && <AboutUsPage />}
            {props.PageSelector === 'Programs' && <ProgramsPage />}
            {props.PageSelector === 'About Us' && <WaitlistInfoPage />}
        </Fragment>
    )
};

export default InformationPages;
